The '''Old key''' is an item that can be found in the north-western room of the [[Sisterhood Sanctuary]], north of [[Kroy]]'s laboratory, which is locked and inaccessible until his death during [[Sins of the Father]].

It is used to open the large chest found on the {{FloorNumber|uk=2}} of church in [[Slepe]], which contains the [[Elixir of Everlasting]], a scroll containing the formula for an ancient potion said to be able to extend the drinker's life indefinitely.

